import React, { useState } from 'react';
import Modal from 'react-modal';
import Login from './login';
import Registration from './registration';
import { setAppElement } from 'react-modal';

import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink,
} from './NavbarElement';

Modal.setAppElement('#root');

const Navbar = () => {
  const [isSignInModalOpen, setSignInModalOpen] = useState(false);
  const [isSignUpModalOpen, setSignUpModalOpen] = useState(false);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const openSignInModal = () => {
    setSignInModalOpen(true);
  };

  const closeSignInModal = () => {
    setSignInModalOpen(false);
  };

  const openSignUpModal = () => {
    setSignUpModalOpen(true);
  };

  const closeSignUpModal = () => {
    setSignUpModalOpen(false);
  };

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };

  const handleSignIn = (e) => {
    e.preventDefault();
    console.log('Signed in with the following data:');
    console.log('Email:', email);
    console.log('Password:', password);
    closeSignInModal();
  };

  const handleSignUp = (e) => {
    e.preventDefault();
    console.log('Signed up with the following data:');
    console.log('Email:', email);
    console.log('Password:', password);
    closeSignUpModal();
  };

return (
	<>
	<Nav>
		<Bars />

		<NavMenu>
		<NavLink to='/home' activeStyle>
			Home
		</NavLink>
		<NavLink to='/about' activeStyle>
			About
		</NavLink>
		<NavLink to='/events' activeStyle>
			Events
		</NavLink>		
		<NavLink to='/games' activeStyle>
			Games
		</NavLink>
		<NavLink to='/signup' activeStyle onClick={openModal}>
            Sign Up
          </NavLink>

		</NavMenu>
		<NavBtn>
		<NavBtnLink onClick={openModal}>Sign In</NavBtnLink>
		</NavBtn>
	</Nav>
	<Modal
        isOpen={isSignUpModalOpen}
        onRequestClose={closeSignUpModal}
        contentLabel="Sign Up Modal"
      >
        <h2>Sign Up</h2>
        <form onSubmit={handleSignUp}>
          <div className="form-group">
            <label>Email:</label>
            <input
              type="email"
              className="form-control"
              value={email}
              onChange={handleEmailChange}
              required
            />
          </div>

          <div className="form-group">
            <label>Password:</label>
            <input
              type="password"
              className="form-control"
              value={password}
              onChange={handlePasswordChange}
              required
            />
          </div>

          <button className="btn btn-primary" type="submit">
            Sign Up
          </button>
          <button className="btn btn-secondary" onClick={closeSignUpModal}>
            Close
          </button>
        </form>
		</Modal>

	<Modal
        isOpen={isModalOpen}
        onRequestClose={closeModal}
        contentLabel="Sign In Modal"
      >
        <h2>Sign In</h2>
        <form className="row g-3">
      <div className="col-md-4">
        <label htmlFor="validationServer01" className="form-label">First name</label>
        <input type="text" className="form-control is-valid" id="validationServer01" defaultValue="Mark" required />
        <div className="valid-feedback">
          
        </div>
      </div>
      <div className="col-md-4">
        <label htmlFor="validationServer02" className="form-label">Last name</label>
        <input type="text" className="form-control is-valid" id="validationServer02" defaultValue="Otto" required />
        <div className="valid-feedback">
          
        </div>
      </div>
      <div className="col-md-4">
        <label htmlFor="validationServerUsername" className="form-label">Email</label>
        <div className="input-group has-validation">
          <span className="input-group-text" id="inputGroupPrepend3">@</span>
          <input type="text" className="form-control is-invalid" id="validationServerUsername" aria-describedby="inputGroupPrepend3 validationServerUsernameFeedback" required />
          <div id="validationServerUsernameFeedback" className="invalid-feedback">
            Please choose a username.
          </div>
        </div>
      </div>
      <div className="col-md-6">
        <label htmlFor="validationServer03" className="form-label">City</label>
        <input type="text" className="form-control is-invalid" id="validationServer03" aria-describedby="validationServer03Feedback" required />
        <div id="validationServer03Feedback" className="invalid-feedback">
          Please provide a valid city.
        </div>
      </div>
      <div className="col-md-3">
        <label htmlFor="validationServer04" className="form-label">State</label>
        <select className="form-select is-invalid" id="validationServer04" aria-describedby="validationServer04Feedback" required>
          <option value="" disabled>Choose...</option>
          <option>...</option>
        </select>
        <div id="validationServer04Feedback" className="invalid-feedback">
          Please select a valid state.
        </div>
      </div>
      <div className="col-md-3">
        <label htmlFor="validationServer05" className="form-label">Zip</label>
        <input type="text" className="form-control is-invalid" id="validationServer05" aria-describedby="validationServer05Feedback" required />
        <div id="validationServer05Feedback" className="invalid-feedback">
          Please provide a valid zip.
        </div>
      </div>
      <div className="col-12">
        <div className="form-check">
          <input className="form-check-input is-invalid" type="checkbox" value="" id="invalidCheck3" aria-describedby="invalidCheck3Feedback" required />
          <label className="form-check-label" htmlFor="invalidCheck3">
            Agree to terms and conditions
          </label>
          <div id="invalidCheck3Feedback" className="invalid-feedback">
            You must agree before submitting.
          </div>
        </div>
      </div>
      <div className="col-12">
        <button className="btn btn-primary" type="submit">Submit </button>
      </div>
    </form>
      </Modal>


	</>
);
};

export default Navbar;
